Have you thought about using transducers to transpile array comprehension to es5 ?

It would require an external dependency (like https://github.com/jlongster/transducers.js, or https://github.com/cognitect-labs/transducers-js) but transducers are a more efficient way of composing transformations while retaining readability.

The difference is negligible for small arrays, but increase dramatically with the size of the array (http://jlongster.com/Transducers.js-Round-2-with-Benchmarks).

Taking your example:

```js
var seattlers = [for (c of customers) if (c.city == "Seattle") { name: c.name, age: c.age }];
```

With transducers it would become:

```js
var seattlers = into([], compose(filter(function (c) {
  return c.city === "Seattle";
}), map(function (c) {
  return { name: c.name, age: c.age };
})), customers);
```

Instead of:

```js
var seattlers = _toArray(customers).filter(function (c) {
  return c.city == "Seattle";
}).map(function (c) {
  return { name: c.name, age: c.age };
});
```
